class InstrumentedCallback:
    """A wrapper class to count accesses to a callback."""
    def __init__(self, func, pass_count=0):
        self.func = func
        self.pass_count = pass_count
        self.call_count = 0
    def reset(self):
        self.call_count = 0
    def __call__(self, *args):
        self.call_count += 1

